import { configureStore } from "@reduxjs/toolkit";
import EmployeeReducer from "./features/employee/EmployeeSlice";
//import AuthReducer from "./component/authSlice/AuthSlice";
import { authActions } from "./component/authSlice/AuthSlice";

export const store = configureStore({
    reducer: {
        counter : EmployeeReducer, authActions
    },
})
